<!DOCTYPE html>
<html lang="zh">

<head>
  <meta charset="utf-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width,initial-scale=1.0">
  <link rel="icon" href="/assets/favicon.ico">
  <title>gypsum panel</title>
  <% var pkg = require('../package.json'); var ver = pkg.dependencies; %>
  <%if (process.env.NODE_ENV==='development' ) { %>
    <script src="https://cdn.jsdelivr.net/npm/core-js-bundle@<%= ver['core-js'] %>/index.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/vue@<%= ver.vue %>/dist/vue.global.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/axios@<%= ver.axios %>/dist/axios.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/crypto-js@<%= ver['crypto-js'] %>/crypto-js.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/element-plus@<%= ver['element-plus'] %>/lib/index.full.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/cronstrue@<%= ver.cronstrue %>/dist/cronstrue-i18n.js"></script>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/element-plus@<%= ver['element-plus'] %>/lib/theme-chalk/index.css">
  <% } else { %>
    <script src="https://cdn.jsdelivr.net/npm/core-js-bundle@<%= ver['core-js'] %>/minified.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/vue@<%= ver.vue %>/dist/vue.runtime.global.prod.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/axios@<%= ver.axios %>/dist/axios.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/crypto-js@<%= ver['crypto-js'] %>/crypto-js.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/element-plus@<%= ver['element-plus'] %>/lib/index.full.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/cronstrue@<%= ver.cronstrue %>/dist/cronstrue-i18n.min.js"></script>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/element-plus@<%= ver['element-plus'] %>/lib/theme-chalk/index.css">
  <% } %>
</head>

<body>
  <noscript>
    <strong>We're sorry but gypsum panel doesn't work properly without JavaScript enabled. Please enable it to continue.</strong>
  </noscript>
  <div id="app"></div>
</body>

</html>
